import Grid from "@mui/material/Grid2";
import styles from "./scss/Login.scss";
import CustomTextField from "../../shared/custom-text-field/CustomTextField";
import { handleLogin } from "./hooks/handleLogin";
import BlackButton from "../../shared/button/BlackButton";
import { Typography } from "@mui/material";
export default function Login() {
  return (
    <Grid container className={styles.pageContainer}>
      <Grid
        container
        sx={{
          // borderRadius: "5px",
          // boxShadow: "0 0 5px 1px #e6e6e6",
          // paddingBottom: "80px",
          // paddingTop: "40px",
          rowGap: "20px",
          maxWidth: "400px",
        }}
      >
        <Grid container width={"100%"}>
          <Typography variant={"h4"}>Welcome back</Typography>
        </Grid>
        <Grid container width={"100%"}>
          <CustomTextField sx={{ width: "80%" }} label={"Username"} />
        </Grid>
        <Grid container width={"100%"}>
          <CustomTextField sx={{ width: "80%" }} label={"Password"} />
        </Grid>
        <Grid container width={"100%"}>
          <BlackButton
            sx={{ width: "80%" }}
            onClick={() => handleLogin("a", "a")}
          >
            Login
          </BlackButton>
        </Grid>
      </Grid>
    </Grid>
  );
}
